import React, { useContext } from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import { AuthProvider, AuthContext } from './context/AuthContext';
import PrivateRoute from './utils/PrivateRoute';
import Homepage from './component/Homepage';
import Dashboard from './component/Dashboard';
import Navbar from './component/Navbar';
import Modules from './component/Modules';
import AuthPage from './component/AuthPage';
import Visprogpage from './component/Visprogpage';
import Quizcomp from './component/Quizcomp';
import RealTimePessimism from './component/RealTimePessimism';

function App() {
  return (
    <Router>
      <AuthProvider>
        <Navbar />
        <Switch>
          <Route path="/authpage" component={AuthPage} exact />
          <PrivateRoute path="/dashboard" exact>
            <Dashboard />
          </PrivateRoute>
          <PrivateRoute path="/modules" exact>
            <Modules />
          </PrivateRoute>
          <PrivateRoute path="/visprogpage" exact>
            <Visprogpage />
          </PrivateRoute>
          <PrivateRoute path="/quizcomp" exact>
            <Quizcomp />
          </PrivateRoute>
          <PrivateRoute path="/realtimepessimism" exact>
            <RealTimePessimism />
          </PrivateRoute>
          <Route path="/" exact>
            <AuthRedirect />
          </Route>
        </Switch>
      </AuthProvider>
    </Router>
  );
}

const AuthRedirect = () => {
  const { user } = useContext(AuthContext);
  return (
    <Redirect to={user ? "/dashboard" : "/authpage"} />
  );
};

export default App;
